  // Helper function to get all available brands
  export const getCarBrands = () => {
    return Object.keys(carsDatabase);
  };
  
  // Helper function to get all models for a specific brand
  export const getModelsByBrand = (brand) => {
    if (!brand || !carsDatabase[brand]) return [];
    return carsDatabase[brand].map(car => car.model);
  };
  
  // Helper function to get available years for a specific model
  export const getYearsByModel = (brand, model) => {
    if (!brand || !model || !carsDatabase[brand]) return [];
    const carModel = carsDatabase[brand].find(car => car.model === model);
    return carModel ? carModel.years : [];
  };